import React from 'react'
import contactImg from '../Assestes/contact.png'


const Contact = () => {
  return (
    <div className='contact'>
        <div className="child">
            <img src={contactImg} alt="contactImg" />
        </div>
        <div className="child"></div>
    </div>
  )
}

export default Contact
